import { Typography, TextField, Grid, Stack, TextareaAutosize, useMediaQuery, Button, Alert, MenuItem } from '@mui/material';
import React, { useState } from 'react';
import PhoneInput from "react-phone-input-2";
import '../App.css';
import 'react-phone-input-2/lib/style.css'
import { useTranslation } from 'react-i18next';
import { createTheme , ThemeProvider} from '@mui/material';

const theme = createTheme({
  palette: {
    primary: {
      main: '#018EA2', 
    },
  },
});
export default function PersonalInfo({name,setName,gender,selectedGender,setselectedGender,phone,
    setPhone,birthday,setBirthday,email,setEmail,lastName,setLastName,setgender}){

    const { t } = useTranslation();
  return (
    <div style={{marginTop:'30px'}}>
        <Stack direction='row' gap={7}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("First Name")}
            </label>
            <TextField
              value={name}
              onChange={(e) => { setName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Last Name")}
            </label>
            <TextField
              value={lastName}
              onChange={(e) => { setLastName(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>
          </Stack>


          <Stack direction='row' gap={7} sx={{marginTop:'20px'}}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Gender")}
            </label>
            <TextField
            select
              value={selectedGender}
              onChange={(e) => { setselectedGender(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}>
            {gender.map((c) => (
                <MenuItem value={c}>
                  {c}
                </MenuItem>
              ))}
              </TextField>
          </Grid>


          <Grid sx={{ display: 'flex', flexDirection: 'column' }}>
  <label style={{ color: '#707070', marginBottom: '10px' }}>
    {t('Birthdate')}
  </label>
  <ThemeProvider theme={theme}>
    <TextField
      value={birthday}
      type="date"
      onChange={(e) => {
        setBirthday(e.target.value);
      }}
      InputLabelProps={{
        sx: {
          color: '#7D4896',
        },
      }}
      sx={{
        width: '400px',
        '.MuiInputBase-root': {
          color: 'black',
          height: '40px',
          border: '1.2px solid #7D4896',
        },
      }}
      inputProps={{
        max: new Date().toISOString().split('T')[0],
      }}
    />
  </ThemeProvider>
</Grid>
          </Stack>

          <Stack direction='row' gap={7} sx={{marginTop:'20px'}}>
         <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Phone Number")}
            </label>
            <PhoneInput
          country={'jo'}
            enableSearch={true}
            value={phone}
            onChange={setPhone}
            inputStyle={{ width: '400px',height:'20px'
            ,color:'black',fontSize:'13px',border: '1.33px solid #7D4896',
            height:'40px',marginTop:'15px'
             }}
          />
          </Grid>


          <Grid sx={{display:'flex',flexDirection:'column'}}>
         <label style={{color:'#707070' , marginBottom:'10px'}}>
            {t("Email")}
            </label>
            <TextField
              value={email}
              type='email'
              onChange={(e) => { setEmail(e.target.value) }}
              InputLabelProps={{
                sx: {
                  color: '#7D4896'
                }
              }}
              sx={{width: '400px',
              '.MuiInputBase-root':{color:"black",height:'40px',border: '1.2px solid #7D4896'} 
            }}
            />
          </Grid>
          </Stack>
    </div>
  )
}
